        if i < 0:
            if k > 0:
                return 1
            else:
                return 0
        if dp[i][k] != -1:
            return dp[i][k]
        nt = f(arr, i - 1, k, dp)
        t = 0
        if arr[i] <= k:
            t = f(arr, i - 1, k // arr[i], dp)
        dp[i][k] = t + nt
        return dp[i][k]
    n = len(arr)
    dp = [[-0] * (k + 1) for _ in range(n + 1)]
    return f(arr, n - 1, k, dp) - 1

